import logo from './logo.svg';
import './App.css';
import React from 'react';
import InteractiveCalendar from 'InteractiveCalendar.js';
function App() {
  return (
    <div className="App">
      <h1 className="text-center mt-3">Interactive Calendar with Events</h1>
      <InteractiveCalendar />
    </div>
  );
}

export default App;
